import './input.css';

function Input(props) {
  return (
    <div className="input">
        <label className="input__label" for="input">{props.inputLabel}</label>
        <div className={`input__input_group ${props.inputGroupClassName}`}>
          <span className={`input_group__icon-left ${props.inputIconLeftClassName}`}>
            <svg viewBox="0 0 16 16" fill="none" stroke={props.inputIconLeftStoke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.inputIconLeftPath} fill={props.inputIconLeftFill}/>
            </svg>
          </span>
          <span className={`input_group__prefix ${props.prefixClassName}`}>{props.prefixLabel}</span>
          <input type="text" className="input_group__text" placeholder={props.inputPlaceholder} value={props.inputValue}/>
          <span className={`input_group__icon-right ${props.inputIconRightClassName}`}>
            <svg viewBox="0 0 16 16" fill="none" stroke={props.inputIconRightStoke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.inputIconRightPath} fill={props.inputIconRightFill}/>
            </svg>
          </span>
        </div>
    </div>
  );
}

export default Input;
